import React from 'react';

function ProductTable() {
  return(
    <table className="product-table">
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <th>test</th>
        </tr>
      </tbody>
    </table>
  )
}

export default ProductTable;
